import './Header.css';

function Header(){
    return(
        <header>
            <div className="header-cell" onClick={() => props.changeTab(1)}></div>
            <div className="header-cell" onClick={() => props.changeTab(2)}></div>
            <div className="header-cell" onClick={() => props.changeTab(3)}></div>
        </header>
    )
}

export default Header;
